height: 10vh;
border: 1px solid black;
margin: 2px;
`

const Title = styled.h3`
  color: #ffff;
`

function FoodsList() {
  return (
    <div>
      <FoodContainer> 
      <Title>Food</Title>
        
      </FoodContainer>
     

     
    </div>
  )
}

export default FoodsList
